import axios from "axios"

export const createUser = async (user) => {
    try {
        var response = await axios.post("https://localhost:7055/User/CreateUser", user);

        return response.status;
    } catch(e) {
        console.error(e);
    }
}

export const isFormValid = (user) => {
    if (user?.name[0] != user?.name[0].toUpperCase()) {
        return false;
    } else if (user?.surname[0] != user?.surname[0].toUpperCase()) {
        return false;
    } else if (user?.email ) {
        return false;
    }
};
